import React from 'react'
import './style.css'

const MovieRow = (props) => {

    return (
        <div className='row--header'>
            <div> {`<`} </div>
            <div id={props.list.slug} key={props.list.slug}>
                <span>{props.list.title}</span>
                <div className='row--imgs' >
                    {props.list.items.results.map(movie =>
                        <img key={movie.id} className='movie--poster' src={`https://image.tmdb.org/t/p/w300${movie.poster_path}`} ></img>)
                    }
                </div>

            </div>
        </div>
    )
}

export default MovieRow;
